class PharmacyModel {
    pharID: string;
    storeName: string;
    address: string;
    province: string;
    city: string;
    latitude: string;
    longitude : string;
    phoneNumber: string;
    serviceTime: string;
    serviceDate: string;
    constructor(
        pharID: string,
        storeName: string,
        address: string,
        province: string,
        city: string,
        latitude: string,
        longitude: string,
        phoneNumber: string,
        serviceTime: string,
        serviceDate: string,
    ) {
        this.pharID = pharID;
        this.storeName = storeName;
        this.address = address;
        this.province = province;
        this.city = city;
        this.latitude = latitude;
        this.longitude = longitude;
        this.phoneNumber = phoneNumber;
        this.serviceTime = serviceTime;
        this.serviceDate = serviceDate;
    }
}

export default PharmacyModel;
